Text:
am vazut aseara ca tare greu merge treaba. De exemplu din serial am putut lua abia primele 2 episoade. La toate celelalte se opreste dld pe la 65%. Cred ca materialele mai vechi le-au mutat pe niste servere mai putin prioritare sa zic asa;

Mai incerc si alta metoda in care sa le iau doar ca dureaza peste o ora pentru fiecare episod si-i nasol...

Voi mai vedea ce se poate face zilele astea, va tin la curent
